import React from 'react';

function QuizTakerPage() {
    return (
        <div style={{ padding: '20px' }}>
            <h2>Take Quiz</h2>
            <p>This feature is under development. Please check back soon!</p>
        </div>
    );
}

export default QuizTakerPage;
